# given an integer array nums, and an integer target, find
# how many unique pairs exist s.t. their sums are equal to target, return num pairs
import random
from time import process_time
def twoSum(nums, target):
    indices = {}
    for i, j in enumerate(nums): # for every index of nums
        if target - j in indices:
            print("%d is the sum of numbers %d and %d" %(target,target-j,j))
            return [indices[target - j], i]
        else:
            indices[j] = i
def createRandomList(num, start, end):
    arr = []
    tmp = random.randint(start, end)
    for x in range(num):
        while tmp in arr:
            tmp = random.randint(start, end)
        arr.append(tmp)
    return arr

